import React from "react";
import { SkillBars } from "react-skills";

const skillsData = [
  {
    name: "ReactJS",
    level: 65,
    height: 21,
    color: "RGBA(131,224,93.1)",
    labelWidth: 208,
  },
  {
    name: "JavaScript",
    level: 85,
    height: 21,
    color: "RGBA(201,90,233,1)",
  },
  {
    name: "MongoDB",
    level: 70,
    height: 21,
    color: "RGBA(62,51,248,1)",
  },
];

// ...
function Skills() {
  return <SkillBars skills={skillsData} />;
}

export default Skills;
